def distro_bin_dir(distro_family: Distro, interactive: bool) -> DistroBinDir:
    """
    Determine the most appropriate bin directory for this distro and its environment.

    :return: Tuple of path to bin directory and details about it
    """

    bin_dir_to_use = ""
    created_dir = False
    user_must_add_to_path = False
    user_must_reboot = False
    dot_profile_has_local_bin = False
    create_sym_link = False

    home = os.path.expanduser("~")
    local_bin = os.path.join(os.path.split(site.getuserbase())[1], "bin")
    path = os.getenv("PATH")

    local_bin_path = os.path.join(home, local_bin)

    if local_bin_path in path and dir_accessible(local_bin_path):
        print("Using existing path {} for program executable".format(local_bin_path))
        bin_dir_to_use = local_bin

    elif distro_family == Distro.debian:
        result = probe_debian_dot_profile(home=home, subdir=local_bin)
        bin_dir_to_use = result.bin_dir_to_use
        created_dir = result.created_dir
        dot_profile_has_local_bin = result.dot_profile_has_local_bin
        user_must_reboot = result.user_must_reboot

    if not bin_dir_to_use:
        # Use ~/bin for everything else. Especially true for openSUSE, because that's
        # the only choice.
        home_bin = os.path.join(home, "bin")
        if dir_accessible(home_bin):
            bin_dir_to_use = "bin"
            if home_bin in path:
                print("Using existing path {} for program executable".format(home_bin))
            else:
                user_must_add_to_path = True

        elif distro_family == Distro.debian:
            result = probe_debian_dot_profile(home=home, subdir="bin")
            bin_dir_to_use = result.bin_dir_to_use
            created_dir = result.created_dir
            user_must_reboot = result.user_must_reboot

        if not bin_dir_to_use:
            if not os.path.isdir(home_bin):
                print("Creating directory", home_bin)
                os.mkdir(home_bin)
                bin_dir_to_use = "bin"
                created_dir = True
            else:
                # Some kind of permissions problem
                print("Fixing ownership or access permissions for", home_bin)
                owner = os.getuid()
                group = os.getgid()
                u_only, u_g_o = folder_perms()
                check_and_repair_folder_permission(
                    path=home_bin,
                    owner=owner,
                    group=group,
                    perm=u_g_o,
                    interactive=interactive,
                )
                # Check if successful
                if dir_accessible(home_bin):
                    bin_dir_to_use = "bin"

            if bin_dir_to_use:
                user_must_add_to_path = not home_bin in path

        if bin_dir_to_use:
            create_sym_link = True

    return DistroBinDir(
        bin_dir_to_use=os.path.join(home, bin_dir_to_use),
        created_dir=created_dir,
        user_must_add_to_path=user_must_add_to_path,
        dot_profile_has_local_bin=dot_profile_has_local_bin,
        user_must_reboot=user_must_reboot,
        create_sym_link=create_sym_link,
    )


def man_pages_already_installed(
    manpages: Tuple[str, str], system_man_dir: str, local_man_dir: str
) -> bool:
    """
    Determine if the same man pages already exist in the system directory that we would
    install into

    :return: True if already installed, False otherwise
    """

    match = 0
    if local_man_dir is not None:
        for manpage in manpages:
            source = os.path.join(local_man_dir, manpage)
            dest = os.path.join(system_man_dir, manpage)
            if (
                os.path.isfile(dest)
                and os.path.isfile(source)
                and filecmp.cmp(dest, source, shallow=False)
            ):
                match += 1
    return match == len(manpages)


def icon_present() -> bool:
    try:
        import gi

        gi.require_version("Gtk", "3.0")
        from gi.repository import Gtk

        icon_name = "rapid-photo-downloader"
        icon_theme = Gtk.IconTheme.get_default()
        icon = icon_theme.lookup_icon(icon_name, 48, 0)
        return not not icon
    except:
        return False


def do_install(
    installer: str,
    distro_details: DistroDetails,
    distro_family: Distro,
    interactive: bool,
    devel: bool,
    delete_install_script: bool,
    delete_tar_and_dir: bool,
    force_this_version: bool,
    venv: bool,
    pyqt5_version: Optional[str],
    use_system_pyqt5: bool,
    is_wsl2: bool,
) -> None:
    """
    :param installer: the tar.gz installer archive (optional)
    :param distro_details: distro, version, pretty name of Linux distribution
    :param distro_family: the family of distros the specific distro is part of
    :param interactive: whether to prompt to confirm commands
    :param devel: download and install latest development version
    :param delete_install_script: hidden command line option to delete the
     install.py script and its containing directory, which is assumed to be
     a temporary directory
    :param delete_tar_and_dir: hidden command line option to delete the
     tar.gz installer archive and its containing directory, which is assumed to be
     a temporary directory
    :param force_this_version: do not attempt to run a newer version of this script
    :param venv: installing into a virtual environment
    :param pyqt5_version: install specific version of PyQt5 from PyPi.
    :param use_system_pyqt5: do not install PyQt5 from PyPi.
    :param is_wsl2: if in WSL2 (Windows Subsystem for Linux v2) environment
    """

    installer_downloaded = False
    if installer is None:
        delete_installer = True
        installer = download_installer(devel)
        installer_downloaded = True
    elif delete_tar_and_dir:
        delete_installer = True
    else:
        delete_installer = False

    if not force_this_version:
        run_latest_install(
            installer=installer,
            delete_installer=delete_installer,
            installer_downloaded=installer_downloaded,
        )

    if delete_installer:
        installer_to_delete_on_error = installer
    else:
        installer_to_delete_on_error = ""

    must_install_pypi_pyqt5 = pypi_pyqt5_capable() and (
        venv or pyqt5_version is not None
    )

    if not use_system_pyqt5 and not must_install_pypi_pyqt5:
        must_install_pypi_pyqt5 = not should_use_system_pyqt5(
            distro_details, distro_family
        )

    if not venv:
        system_uninstall = uninstall_old_version(
            distro_family=distro_family,
            interactive=interactive,
            installer_to_delete_on_error=installer_to_delete_on_error,
        )
        local_man_dir = os.path.join(os.path.expanduser("~"), ".local/share/man/man1")
        if not os.path.isdir(local_man_dir):
            try:
                os.makedirs(local_man_dir)
            except Exception:
                sys.stderr.write(
                    "Sorry, the man page directory could not be created: {}\n"
                    "Exiting...\n".format(local_man_dir)
                )
                cleanup_on_exit(installer_to_delete_on_error="")
                sys.exit(1)
    else:
        system_uninstall = False
        local_man_dir = None

    install_required_distro_packages(
        distro=distro_details.distro,
        distro_family=distro_family,
        interactive=interactive,
        system_uninstall=system_uninstall,
        venv=venv,
        install_pyqt5=not must_install_pypi_pyqt5,
        installer_to_delete_on_error=installer_to_delete_on_error,
    )

    with tarfile.open(installer) as tar:
        with tar.extractfile(
            tarfile_content_name(installer, "requirements.txt")
        ) as requirements:
            reqbytes = requirements.read()
            # Remove PyQt5 from requirements as we will be installing it manually below
            reqbytes = reqbytes.replace(b"pyqt5", b"")
            if is_wsl2 and False:
                # One day, perhaps, there will be no need to install gphoto2
                regex = b"gphoto2.*?$"
                reqbytes = re.sub(regex, b"", reqbytes, flags=re.MULTILINE)

            with tempfile.NamedTemporaryFile(delete=False) as temp_requirements:
                temp_requirements.write(reqbytes)
                temp_requirements_name = temp_requirements.name

    print("\n" + _("Installing application requirements...") + "\n")

    # Don't call pip directly - there is no API, and its developers say not to
    cmd = make_pip_command(
        "install {} --disable-pip-version-check -r {}".format(
            pip_user, temp_requirements.name
        )
    )
    i = popen_capture_output(cmd)
    os.remove(temp_requirements_name)
    check_install_status(
        i=i,
        installer_to_delete_on_error=installer_to_delete_on_error,
        is_requirements=True,
    )

    if venv:
        i = install_pygobject_from_pip()
        check_install_status(
            i=i,
            installer_to_delete_on_error=installer_to_delete_on_error,
            is_requirements=True,
        )

    print()
    i = install_pyheif_from_pip()
    if i != 0:
        check_install_status(
            i=i,
            installer_to_delete_on_error=installer_to_delete_on_error,
            is_requirements=True,
            warning_only=True,
            package_name="pyheif",
        )
        print(_("System support for generating HEIF / HEIC thumbnails is unavailable"))

    remove_rawkit()

    if must_install_pypi_pyqt5:
        # Update PyQt5 and PyQt5_sip separately. Sometimes it's possible for
        # PyQt5 and PyQt5_sip to get out of sync
        i = update_pyqt5_and_sip(version=pyqt5_version)
        check_install_status(
            i=i,
            installer_to_delete_on_error=installer_to_delete_on_error,
            is_requirements=True,
        )
    else:
        uninstall_pip_package("PyQt5", no_deps_only=False)
        uninstall_pip_package("PyQt5_sip", no_deps_only=False)

    print("\n" + _("Installing application...") + "\n")
    cmd = make_pip_command(
        'install {} --disable-pip-version-check --no-deps "{}"'.format(
            pip_user, installer
        )
    )
    i = popen_capture_output(cmd)
    check_install_status(
        i=i,
        installer_to_delete_on_error=installer_to_delete_on_error,
        is_requirements=False,
    )

    if venv:
        bin_dir = os.path.join(sys.prefix, "bin")
        user_must_add_to_path = True
        user_must_reboot = False
        print("\nThe application was installed in {}".format(bin_dir))
    else:
        distro_bin_probe = distro_bin_dir(distro_family, interactive)

        bin_dir = distro_bin_probe.bin_dir_to_use
        user_must_add_to_path = distro_bin_probe.user_must_add_to_path
        user_must_reboot = distro_bin_probe.user_must_reboot
        create_sym_link = distro_bin_probe.create_sym_link

        if bin_dir and create_sym_link:
            install_path = os.path.join(site.getuserbase(), "bin")

            for executable in ("rapid-photo-downloader", "analyze-pv-structure"):
                symlink = os.path.join(bin_dir, executable)

                # Catch broken symlinks
                if not (os.path.exists(symlink) or os.path.islink(symlink)):
                    print("Creating symlink", symlink)
                    print(
                        "If you uninstall the application without using this "
                        "install.py script, remove this symlink yourself."
                    )
                    os.symlink(os.path.join(install_path, executable), symlink)
                else:
                    if os.path.islink(symlink):
                        if os.readlink(symlink) == os.path.join(
                            install_path, executable
                        ):
                            print("Correct symlink already exists:", symlink)
                        else:
                            msg = (
                                'Symlink "{}" already exists, but points to "{}" '
                                'instead of "{}" '
                            )
                            print(
                                msg.format(
                                    symlink,
                                    os.readlink(symlink),
                                    os.path.join(install_path, executable),
                                )
                            )
                            answer = input("Should the symlink be replaced?")
                            if get_yes_no(answer):
                                os.unlink(symlink)
                                os.symlink(
                                    os.path.join(install_path, executable), symlink
                                )
                    else:
                        print(
                            "There is another file at targeted symlink location:",
                            symlink,
                        )

    if is_wsl2 and not venv:
        desktop_file = "net.damonlynch.rapid_photo_downloader.desktop"
        desktop_file_home_path = os.path.join(
            os.path.expanduser("~"),
            f".local/share/applications/{desktop_file}",
        )
        applications_dir = "/usr/share/applications"
        desktop_file_app_path = os.path.join(applications_dir, desktop_file)
        if not os.path.isfile(desktop_file_app_path) or not filecmp.cmp(
            desktop_file_home_path,
            desktop_file_app_path,
            shallow=False,
        ):
            if interactive:
                answer = input(
                    "\n"
                    + _(
                        "Do you want Rapid Photo Downloader to appear in the Windows "
                        "menu?"
                    )
                    + "  [Y/n] "
                )
            else:
                print("\n" + _("Adding Rapid Photo Downloader to the Windows menu"))
                answer = "y"
            if get_yes_no(answer):
                cmd = shutil.which("cp")
                command_line = f"sudo {cmd} {desktop_file_home_path} {applications_dir}"
                print(command_line)
                args = shlex.split(command_line)
                try:
                    subprocess.check_call(args)
                except subprocess.CalledProcessError:
                    sys.stderr.write(_("Failed to copy application launcher.") + "\n")

    system_man_dir = "/usr/local/share/man/man1"

    manpages = ("rapid-photo-downloader.1",)

    if venv:
        # Keep man pages in install location only

        # Translators: do not translate {}/share/man/man1
        print(
            "\n" + _("Man pages can be found in {}/share/man/man1").format(sys.prefix)
        )

    elif not man_pages_already_installed(manpages, system_man_dir, local_man_dir):
        if interactive:
            print("\n" + _("Do you want to install the application's man pages?"))
            print(_("They will be installed into {}").format(system_man_dir))
            print(
                _("If you uninstall the application, remove these manpages yourself.")
            )
            print(_("sudo may prompt you for the sudo password."))
            answer = input(_("Do want to install the man pages?") + "  [Y/n] ")
        else:
            print("\n" + _("Installing man pages into {}").format(system_man_dir))
            print(
                _("If you uninstall the application, remove these manpages yourself.")
            )
            print(_("sudo may prompt you for the sudo password.") + "\n")
            answer = "y"

        if get_yes_no(answer):
            install_man_page = True
            if not os.path.isdir(system_man_dir):
                cmd = shutil.which("mkdir")
                command_line = f"sudo {cmd} -p {system_man_dir}"
                print(command_line)
                args = shlex.split(command_line)
                try:
                    subprocess.check_call(args)
                except subprocess.CalledProcessError:
                    sys.stderr.write(
                        _("Failed to create man page directory: exiting.") + "\n"
                    )
                    install_man_page = False

            if install_man_page:
                cmd = shutil.which("cp")
                for manpage in manpages:
                    source = os.path.join(local_man_dir, manpage)
                    if not os.path.exists(source):
                        sys.stderr.write(
                            f"Man page {source} cannot be copied because it does "
                            "not exist\n"
                        )
                        break
                    dest = os.path.join(system_man_dir, manpage)
                    command_line = "sudo {} {} {}".format(cmd, source, dest)
                    print(command_line)
                    args = shlex.split(command_line)
                    try:
                        subprocess.check_call(args)
                    except subprocess.CalledProcessError:
                        sys.stderr.write(_("Failed to copy man page.") + "\n")

    if delete_installer:
        delete_installer_and_its_temp_dir(installer)

    if delete_install_script:
        delete_installer_and_its_temp_dir(sys.argv[0])

    clean_locale_tmpdir()

    update_desktop_database = shutil.which("update-desktop-database")
    if update_desktop_database:
        try:
            from PyQt5.QtCore import QStandardPaths

            xdg_data_home = QStandardPaths.writableLocation(
                QStandardPaths.GenericDataLocation
            )
        except ImportError:
            try:
                import xdg.BaseDirectory

                xdg_data_home = xdg.BaseDirectory.xdg_data_home
            except ImportError:
                d = os.getenv("XDG_DATA_HOME")
                xdg_data_home = (
                    d if d else os.path.join(os.path.expanduser("~"), ".local/share")
                )

        app_dir = os.path.join(xdg_data_home, "applications")
        cmd = f"{update_desktop_database} -q {app_dir}"
        command_line = shlex.split(cmd)
        subprocess.call(command_line)

    if venv:
        # Show path to start script in virtual environment
        print()
        # Translators: don't translate {}/bin/rapid-photo-downloader
        msg = _(
            "Rapid Photo Downloader can be started without activating the virtual "
            "environment by running {}/bin/rapid-photo-downloader"
        ).format(sys.prefix)

        print(f"{bcolors.BOLD}{msg}{bcolors.ENDC}")

    if display_rpmfusion_message:
        print(rpmfusion_message)

    msg = ""
    if user_must_reboot:
        if not is_wsl2:
            msg = _(
                "You may have to restart the computer to be able to run the "
                "program from the command line or application launcher."
            )
        else:
            # WSL refers to the Windows Subsystem for Linux
            msg = _(
                "You may have to restart WSL to be able to run the program "
                "from the command line."
            )
    elif user_must_add_to_path or not bin_dir:
        if not bin_dir:
            path = os.path.join(site.getuserbase(), "bin")
        else:
            path = bin_dir
        if venv:
            msg = _(
                "You must add {path} to your computer's $PATH variable to run the "
                "program from the command line."
            ).format(path=path)
        else:
            msg = _(
                "You must add {path} to your computer's $PATH variable to run the "
                "program from the command line or application launcher."
            ).format(path=path)
    if msg:
        cmd = shutil.which("zenity")
        if cmd is None:
            print(bcolors.BOLD + "\n" + msg + bcolors.ENDC)
        else:
            icon_name = ""
            if not venv and icon_present():
                icon_name = "--icon-name=rapid-photo-downloader"
            text = "\n".join(textwrap.wrap(msg, width=50))
            command_line = (
                f"{cmd} --info --no-wrap "
                f'--title="Rapid Photo Downloader" {icon_name} '
                f'--text="{text}"'
            )
            args = shlex.split(command_line)
            subprocess.call(args=args)

    if False:
        print(
            "\n" + _("(If a segmentation fault occurs at exit, you can ignore it...)")
        )
    print(_("Done."))


def clean_locale_tmpdir():
    global locale_tmpdir
    if locale_tmpdir is not None and os.path.isdir(locale_tmpdir):
        shutil.rmtree(locale_tmpdir, ignore_errors=True)
    locale_tmpdir = None


def pip_needed_to_uninstall():
    sys.stderr.write(
        # Translators: do not translate the terms python3 or pip
        _(
            "The python3 tool pip is required to uninstall a version of Rapid Photo "
            "Downloader that was installed with pip.\nCannot continue. Exiting."
        )
        + "\n"
    )
    sys.exit(1)


def distro_too_old(distro_details: DistroDetails) -> bool:
    minimum = MinimumVersions.get(distro_details.distro.name)
    if minimum:
        return unknown_version < distro_details.version < minimum
    return False


def main():
    """
    Setup localization, if needed.
    Setup core Python modules if needed: pip, setuptools, wheel, and requests
    Setup repositories if needed.
    Then call main install logic.
    """

    if sys.version_info < (3, 6):
        sys.stderr.write("Sorry the minimum required version of Python is 3.6.\n")
        sys.exit(1)

    global pip_user

    parser = parser_options()

    args = parser.parse_args()

    global locale_tmpdir
    locale_tmpdir = args.locale_tmpdir

    if locale_tmpdir is None:
        # if user's locale is other than English, extract mo files to temp dir
        # and localize this script
        try:
            lang = locale.getdefaultlocale()[0]
            assert lang
        except Exception:
            sys.stderr.write("Warning: could not determine locale\n")
        else:
            if not lang.startswith("en"):
                locale_tmpdir = extract_mo_files()

    if locale_tmpdir:
        locale_dir = os.path.join(locale_tmpdir, "locale")
        gettext.bindtextdomain(i18n_domain, localedir=locale_dir)
        gettext.textdomain(i18n_domain)

    if os.getuid() == 0:
        sys.stderr.write(
            _(
                "Do not run this installer script as sudo / root user.\nRun it using the "
                "user who will run the program.\n"
            )
        )
        clean_locale_tmpdir()
        sys.exit(1)

    use_system_pyqt5 = args.use_system_PyQt5 is not None

    if args.PyQt5_version is not None and use_system_pyqt5:
        sys.stderr.write(
            # Translators: do not translate the terms --PyQt5-version or --use-system-PyQt5
            _("Specify only one of --PyQt5-version or --use-system-PyQt5.")
            + "\n"
        )
        clean_locale_tmpdir()
        sys.exit(1)

    pyqt5_version = None
    if args.PyQt5_version is not None:
        if not pypi_pyqt5_capable():
            sys.stderr.write(
                # Translators: do not translate the terms PyQt5 or Python 3.5
                _(
                    "Sorry, specifying a specific version of PyQt5 "
                    "requires Python 3.5 or newer on an Intel or AMD 64 bit platform."
                )
                + "\n"
            )
            cleanup_on_exit(installer_to_delete_on_error="")
            sys.exit(1)

        if version_no_valid(args.PyQt5_version):
            pyqt5_version = args.PyQt5_version.strip()
        else:
            sys.stderr.write(
                _(
                    # Translators: do not translate the term PyQt5
                    "Please specify a PyQt5 version in the format X.X or X.X.X"
                )
                + "\n"
            )
            cleanup_on_exit(installer_to_delete_on_error="")
            sys.exit(1)

        if not pypi_version_exists(package_name="PyQt5", version=pyqt5_version):
            cleanup_on_exit(installer_to_delete_on_error="")
            sys.exit(1)

    venv = args.virtual_env

    if is_venv() and not venv:
        answer = input(
            _(
                "Do you want to install Rapid Photo Downloader into the current "
                "virtual environment?"
            )
            + "  [Y/n] "
        )
        venv = get_yes_no(answer)
        if venv:
            sys.argv.append(virtual_env_cmd_line_arg)

    if venv:
        if not pypi_pyqt5_capable():
            sys.stderr.write(
                # Translators: do not translate the term Python 3.5
                _(
                    "Sorry, installing Rapid Photo Downloader into a Python virtual "
                    "environment requires Python 3.5 or newer on an Intel or AMD 64 "
                    "bit platform."
                )
                + "\n"
            )
            cleanup_on_exit(installer_to_delete_on_error="")
            sys.exit(1)

        if not is_venv():
            sys.stderr.write(
                # Translators: do not translate the term Python
                _(
                    "To install Rapid Photo Downloader into a Python virtual "
                    "environment, create and activate the virtual environment before "
                    "starting this script."
                )
                + "\n"
            )
            cleanup_on_exit(installer_to_delete_on_error="")
            sys.exit(1)
        # install Python packages in active virtual environment
        pip_user = ""
        print(_("Using virtual environment for installation using pip."))

    if args.uninstall_with_deps:
        if len(sys.argv) > 2:
            sys.stderr.write(
                _("Do not include any other command line arguments when specifying")
                + " --uninstall-with-pip-dependencies\n"
            )
            clean_locale_tmpdir()
            sys.exit(1)
        if not have_pip:
            pip_needed_to_uninstall()
        uninstall_with_deps()
        cleanup_on_exit(installer_to_delete_on_error="")
        sys.exit(0)

    if args.uninstall:
        if len(sys.argv) > 2:
            sys.stderr.write(
                _("Do not include any other command line arguments when specifying")
                + " --uninstall\n"
            )
            sys.exit(1)
        if not have_pip:
            pip_needed_to_uninstall()
        uninstall_pip_package("rapid-photo-downloader", no_deps_only=False)
        cleanup_on_exit(installer_to_delete_on_error="")
        sys.exit(0)

    os_release = parse_os_release()

    distro_details = parse_distro_details(os_release)

    if custom_python() and not venv and distro_details.distro != Distro.gentoo:
        excecutable = valid_system_python()
        if excecutable is None:
            sys.stderr.write(
                _(
                    "Sorry, this installer does not support a custom python "
                    "installation.\nExiting..."
                )
                + "\n"
            )
            cleanup_on_exit(installer_to_delete_on_error="")
            sys.exit(1)
        else:
            print(_("Restarting script using system python...") + "\n")
            restart_script(restart_with=excecutable)

    local_folder_permissions(interactive=args.interactive)

    is_wsl2 = detect_wsl2()
    if is_wsl2:
        wsl2 = "(WSL2)"
    else:
        wsl2 = ""

    if not args.script_restarted:
        print(
            _("Detected Linux distribution {} {}").format(
                distro_details.pretty_name, wsl2
            )
        )

    if distro_too_old(distro_details):
        sys.stderr.write(
            "Sorry, this Linux Distribution is too old to be supported by Rapid Photo "
            "Downloader.\n"
        )
        clean_locale_tmpdir()
        sys.exit(1)
    elif distro_details.distro in arch_like:
        print(
            "Users of Arch Linux or its derivatives should use the Arch community "
            "package, or the AUR package."
        )
        print(_("Exiting..."))
        clean_locale_tmpdir()
        sys.exit(0)
    elif distro_details.distro == Distro.centos7:
        print(f"Sorry {distro_details.pretty_name} is no longer supported")
        print(_("Exiting..."))
        clean_locale_tmpdir()
        sys.exit(0)

    distro_family = distro_details.distro

    if distro_details.distro in debian_like:
        distro_family = Distro.debian

        if distro_details.distro in (Distro.ubuntu, Distro.peppermint):
            enable_universe(args.interactive)

        if not have_apt:
            if not custom_python():
                # Translators: do not translate the term python3-apt
                print(
                    _("To continue, the package python3-apt must be installed.") + "\n"
                )
                command_line = make_distro_packager_command(
                    distro_family, "python3-apt", args.interactive
                )
                run_cmd(command_line, restart=True, interactive=args.interactive)
    elif distro_details.distro in fedora_like:
        # Includes all varieties of CentOS >= 8
        distro_family = Distro.fedora

        if distro_details.distro in centos_family:
            enable_centos_epel(
                distro_details=distro_details, interactive=args.interactive
            )
        enable_rpmfusion_free(
            distro_details=distro_details, interactive=args.interactive
        )

    packages = system_python_packaging_tools_required(
        distro=distro_details.distro, venv=venv
    )

    if packages:
        packages = " ".join(packages)

        if distro_family not in (
            Distro.fedora,
            Distro.debian,
            Distro.opensuse,
        ):
            sys.stderr.write(
                _(
                    "Install the following packages using your Linux distribution's "
                    "standard package manager, and then rerun this installer:"
                )
                + "\n"
            )
            sys.stderr.write(packages + "\n")
            cleanup_on_exit(installer_to_delete_on_error="")
            sys.exit(1)

        print(
            # Translators: do not translate the term Python 3
            _(
                "To run this program, programs to assist Python 3 and its package "
                "management must be installed."
            )
            + "\n"
        )

        command_line = make_distro_packager_command(
            distro_family, packages, args.interactive
        )
        run_cmd(command_line, restart=True, interactive=args.interactive)

    if venv and need_wheel:
        print(
            _(
                # Translators: "not system-wide" in this context means "not for the entire system"
                "These Python3 packages will be upgraded for your user (i.e. not system-wide): {}"
            ).format("wheel")
        )
        command_line = make_pip_command(f"install {pip_user} wheel", split=False)
        run_cmd(command_line, restart=True, interactive=args.interactive)

    # Can now assume that pip, setuptools and wheel have been installed

    if not (args.no_check_packaging_tools or venv):
        tools = user_installed_packaging_tools()
        if tools:
            remove_unneeded_user_installed_tools(
                tools=tools, distro_family=distro_family, distro=distro_details
            )

    dated_python_packaging_tools = packaging_tools_out_of_date()

    if dated_python_packaging_tools:
        if args.do_not_upgrade_pip:
            sys.stderr.write(
                "The Python packaging tool pip must be upgraded to continue.\n"
                "Exiting\n"
            )
            sys.exit(1)
        else:
            update_pip_setuptools_wheel(
                interactive=args.interactive, packages=dated_python_packaging_tools
            )

    installer = args.tarfile

    if installer is None:
        if have_requests is False:
            # Translators: do not translate the term python or requests
            print(_("Installing python requests"))
            command_line = make_pip_command(
                "install {} requests".format(pip_user), split=False
            )
            run_cmd(command_line, restart=True, interactive=args.interactive)
    elif not os.path.exists(installer):
        print(_("Installer not found:"), installer)
        sys.exit(1)
    elif not installer.endswith(".tar.gz"):
        # Translators: do not translate the term tar.gz
        print(_("Installer not in tar.gz format:"), installer)
        sys.exit(1)

    do_install(
        installer=installer,
        distro_details=distro_details,
        distro_family=distro_family,
        interactive=args.interactive,
        devel=args.devel,
        delete_install_script=args.delete_install_script,
        delete_tar_and_dir=args.delete_tar_and_dir,
        force_this_version=args.force_this_version,
        venv=venv,
        pyqt5_version=pyqt5_version,
        use_system_pyqt5=use_system_pyqt5,
        is_wsl2=is_wsl2,
    )


